import React, { Component } from 'react'

export default class ClassCard extends Component {
    render() {
        return (
            <div className="ui link centered cards">
                <div id="chef-card" className="card" >
                        <div className="image">
                            <img alt="recipe" src= {this.props.klass.img}/> 
                        </div>
                        <div className="content">
                            <div className="header center-name">{this.props.klass.name}</div>
                            <div className="description center-about"> {this.props.klass.level}</div>
                        </div>
                    </div>

            </div>
        )
    }
}
